sourcesContent:
//todos los archivos intermediarios entre mi página y cualquier otra cosa
//crear objeto con varios atributos entre ellos index
//la función render me lleva a otra página en este caso index

import { getConnection } from "../models/connection"

const indexController = {}

indexController.index = (req, res)=>{ //req recibidr y res para responder peticiones

    res.render ('index', {
        title: 'La Magia'
    })

}



indexController.menu = (req, res)=>{ //req recibidr y res para responder peticiones

    res.render ('menu', {
        title: 'menu'
    })

}

indexController.login = (req, res)=>{ //req recibidr y res para responder peticiones

    res.render ('login', {
        title: 'login'
    })

}

indexController.eventos = (req, res)=>{ //req recibidr y res para responder peticiones

    res.render ('eventos', {
        title: 'eventos'
    })

}

indexController.contacto = (req, res)=>{ //req recibidr y res para responder peticiones

    res.render ('contacto', {
        title: 'contacto'
    })

}

indexController.listarCliente = async (req, res)=> {

    try {
        const conex = await getConnection ()
        const result = await conex.request().query('SELECT * FROM Cliente')
        res.render('cliente', {data : result.recordset})
    
    }catch (error){
        console.log (error)
    }
}

indexController.insertarCliente = async (req, res) => {

    try {
    
    const conex = await getConnection ()
    const {Id_Cliente, Nombre_Cli, Apellido_Cli, Telefono_Cli, Correo_Cli} = req.body //name del formulario
    conex.request().query("insert into Cliente(Id_Cliente, Nombre_Cli, Apellido_Cli, Telefono_Cli, Correo_Cli) values ('" + Id_Cliente + "', '" + Nombre_Cli + "', '" + Apellido_Cli + "', '" + Telefono_Cli + "', '" + Correo_Cli + "')")//var de la BD
    res.redirect('cliente')

    } catch (error) {
        console.log(error)
        
    }
}
indexController.listarReserva = async (req, res)=> {

try {
    const conex = await getConnection ()
    const result = await conex.request().query('SELECT * FROM Reservas')
    res.render('reservas', {data : result.recordset})

}catch (error){
    console.log (error)
}

}

indexController.realizarReserva = async (req, res) => {

    try {
    
    const conex = await getConnection ()
    const {Id_Cliente, Id_Mesa, Id_Reserva, Fecha_Reserva, Hora_Reserva} = req.body //name del formulario
    conex.request().query("insert into Reservas(Id_Cliente, Id_Mesa, Id_Reserva, Fecha_Reserva, Hora_Reserva) values ('" + Id_Cliente + "', '" + Id_Mesa + "', '" + Id_Reserva + "', '" + Fecha_Reserva + "', '" + Hora_Reserva + "')")//var de la BD
    res.redirect('reservas')

    } catch (error) {
        console.log(error)
        
    }
}
//se debe exportar el módulo para poderlo utilizar
export default indexController

