import express from 'express';
import indexController from '../controllers/index.controller';

const router = express.Router();

// Rutas existentes
router.get('/', indexController.index);

// Ruta para el inicio de sesión
router.get('/login', indexController.mostrarFormularioLogin); // Mostrar formulario de inicio de sesión
router.post('/login', indexController.iniciarSesion); // Procesar inicio de sesión

// Ruta para mostrar el formulario de registro de empleado
router.get('/RegistrarEmpleado', indexController.mostrarFormularioRegistroEmpleado);
// Ruta para manejar el envío del formulario de registro de empleado
router.post('/RegistrarEmpleado', indexController.registrarEmpleado); // Aquí asegúrate de que registrarEmpleado esté definido en indexController

export default router;

